@DrKW12 @amywaller77 @NSWHealth There's a great piece by @zeynep on the role of #overdispersion in super-spreading.
To sum up, we don't yet know what features matter at the *individual* level, but we do know masks, ventilation, testing + limiting indoor groups works well for populations.
https://t.co/tWNFrGKOkS

